import React, { Component } from 'react';
import Head from "next/head";

export default class Contact extends Component {
    render() {
        return (
            <div>
              <Head>
                <meta name="viewport" content="width=device-width,minimum-scale=0.5,initial-scale=1"></meta>
              </Head>
              <div className="border-top"></div>
              <div className="contact">
                <div className="contact-box">
                    <form>
                        <div className="form-group"></div>
                    </form>
                </div>
              </div>
              <div className="border"></div>
        <style jsx>{`
        .border-top{
            border-top: 20vh solid white;
            border-left: 100vw solid #000;
        }
    
        .border{
            border-bottom: 20vh solid white;
            border-right: 100vw solid #000;
        }
            .contact{
                height:50vh;
                background-color: rgb(234, 247, 251);
            }
        `}</style>
            </div>
        )
    }
}
